@ericschrijver: 3 approaches to deal with public domain as a heritage organisation:
- Liberal: enabling simple reuse of public domain works;
- Exclusive: legally binding contracts prohibiting commercial reuse;
- Inclusive: encouraging re-use of your collection. https://t.co/dAbt9KkO66

